import React from 'react';
import './Intro.scss'
import img2 from './welcome_screen_1 1.jpg';

const Intro = () => {
  return (
    <>
      <section className='wrapper'>
          <div className='intro'>
              <h2 className='intro__title'>This is an Internal test task</h2>

              <div className='intro__content'>
                  <div className='intro__content--hello'>Hello, don’t be afraid</div>
                  <div className='intro__content--text'>This task is easier than looks like. It’s no magic, no quests and no math here. Only your skill in semantic markup matters. In this Figma design you already have everything to successfully path our test, just be attentive to details, take your time and GOOD LUCK.</div>
              </div>

              <div>
                <img className='' src={img2} alt='logo' width='359' height='400'/>
            </div>
            
          </div>
          
    
      </section>
     
    </>
  );
}

export default Intro;
